import { useEffect } from "react";
import GoogleMap from "../components/GoogleMap";
import ContactFormComponent from "../components/contact/ContactFormComponent";
import ContactUsInfoComponent from "../components/contact/ContactUsInfoComponent";
import "animate.css/animate.min.css";
// import { AnimationOnScroll } from 'react-animation-on-scroll';
import AnimationOnScroll from '../components/AnimationOnScroll';


function ContactUsPage() {
    let publicPath = process.env.PUBLIC_URL;
    useEffect(() => {
        window.scrollTo(0, 0);
    }, []);

    return (
        <div className="mt-70 contactSection">
            <div className="">
                <img src={publicPath + "/assets/images/bannerimages/contactus.jpg"} alt="" className="img-fluid w-100" />
            </div>
            <div className="contactForm">
                <div className="contactEnquiryPage">
                    <div className="container">
                        <div className="row justify-content-center align-items-center">
                            {/* <div className="col-md-5">

                                    <div className="contactImgs text-center">
                                        <img src={publicPath + "/assets/images/contactus.jpg"} alt="" className="img-fluid" />
                                    </div>

                            </div> */}
                            <div className="col-md-8 mt-5 pt-3">

                                    <div className="contactformsection">
                                        <div className="row">
                                            <div className="col-md-10">
                                                <ContactFormComponent />
                                            </div>
                                            <div className="col-md-2">
                                                <div className="ContactformRightImg">
                                                    <img src={publicPath + "/assets/images/Enquirenow.png"} className="img-fluid" alt="" />
                                                </div>
                                            </div>
                                        </div>
                                    </div>

                            </div>
                        </div>
                    </div>
                </div>
                <ContactUsInfoComponent />
            </div>
            <div className="map">
                <GoogleMap width="100%" height="350" address="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2483.3491699028236!2d-0.14593968453448386!3d51.50680977963498!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4876052855b94f03%3A0x39a2ddd0d32d56fc!2s5%20Bolton%20St%2C%20London%20W1J%208BA%2C%20UK!5e0!3m2!1sen!2sin!4v1638256516494!5m2!1sen!2sin" />
            </div>
        </div>
    );
}

export default ContactUsPage;
